// Resto del codice JavaScript
const contattiContainer = document.getElementById('contattiContainer');
const resultsCountElement = document.getElementById('resultsCount');
const noResultsElement = document.getElementById('noResults');

const toggleChrono = document.getElementById('toggleChrono');
const toggleAlpha  = document.getElementById('toggleAlpha');

const searchInput = document.getElementById('searchInput');
const clearSearchBtn = document.getElementById('clearSearch');

let CURRENT_MODE = 'chrono';
let AUTO_SCROLL_PENDING = false;

const TODAY = new Date();
const TODAY_MM = TODAY.getMonth() + 1;
const TODAY_DD = TODAY.getDate();
const CURRENT_YEAR = TODAY.getFullYear();

document.addEventListener('DOMContentLoaded', () => {
    setMode('chrono');
    updateStats(FULL_CONTACTS.length);
});

searchInput.addEventListener('input', (e) => {
    const q = e.target.value;
    updateClearButton(q);
    applySearch(q);
    if (q) {
        scrollToFirstMatch();
    }
});

clearSearchBtn.addEventListener('click', () => {
    searchInput.value = '';
    updateClearButton('');
    applySearch('');
    searchInput.focus();
    if (CURRENT_MODE === 'chrono') {
        AUTO_SCROLL_PENDING = true;
        applySearch('');
    }
});

toggleChrono.addEventListener('click', () => {
    setMode('chrono');
    if (searchInput.value === '') {
        AUTO_SCROLL_PENDING = true;
    }
});
toggleAlpha.addEventListener('click', () => setMode('alpha'));

function setMode(mode) {
    CURRENT_MODE = mode;
    if (mode === 'chrono') {
        toggleChrono.classList.add('active');
        toggleAlpha.classList.remove('active');
    } else {
        toggleAlpha.classList.add('active');
        toggleChrono.classList.remove('active');
        AUTO_SCROLL_PENDING = false;
    }
    applySearch(searchInput.value);
}

function updateClearButton(q) {
    clearSearchBtn.classList.toggle('hidden', !q || q.length === 0);
}

function escapeRegExp(str) {
    return str.replace(/[.*+?^${}()|[\]\\]/g, '\\$&');
}

function highlightText(text, query) {
    if (!query) return text;
    const words = (query || '').toLowerCase().trim().split(/\s+/).filter(Boolean);
    const wordsNoDigits = words.filter(w => !/^\d+$/.test(w));
    if (!wordsNoDigits.length) return text;
    const rx = new RegExp(`(${wordsNoDigits.map(w => escapeRegExp(w)).join('|')})`, 'gi');
    return text.replace(rx, '<mark>$1</mark>');
}

function formatNumberWithDots(number) {
    return number.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ".");
}

function updateStats(n) {
    resultsCountElement.textContent = `Risultati: ${formatNumberWithDots(n)}`;
}

function getSourceForMode() {
    if (CURRENT_MODE === 'alpha') {
        return [...FULL_CONTACTS].sort((a,b) => a.nome_completo.localeCompare(b.nome_completo, 'it', {sensitivity:'base'}));
    }
    const withBday = FULL_CONTACTS.filter(c => Number.isInteger(c.bday_mm) && Number.isInteger(c.bday_dd));
    withBday.sort((a,b) => {
        const k1 = (a.bday_mm ?? 99)*100 + (a.bday_dd ?? 99);
        const k2 = (b.bday_mm ?? 99)*100 + (b.bday_dd ?? 99);
        if (k1 !== k2) return k1 - k2;
        return a.nome_completo.localeCompare(b.nome_completo, 'it', {sensitivity:'base'});
    });
    return withBday;
}

function lineIsBracketed(l) { return l.includes('[') && l.includes(']'); }
function normalizeBracketPrefix(l) { return l.startsWith('*[') ? '[' + l.slice(2) : l; }
function bracketLineShouldHide(l) { return /&&|==|>>/.test(l); }

function visibleBlobForContact(c) {
    let telText = '';
    if (c.telefoni) {
        for (const [tipo, numero] of Object.entries(c.telefoni)) {
            telText += ' ' + String(tipo) + ' ' + String(numero);
        }
    }
    const groupsText = (c.groups_names || []).map(n => `*${n}`).join(' ');
    const all = (c.note || '').split('\n').map(s => s.trim()).filter(Boolean).map(normalizeBracketPrefix);
    const plain = all.filter(l => !lineIsBracketed(l));
    const bracket = all.filter(l => lineIsBracketed(l) && !bracketLineShouldHide(l));
    const notesText = (plain.concat(bracket)).join(' ');
    return (c.nome_completo + ' ' + groupsText + ' ' + telText + ' ' + notesText).toLowerCase();
}

function cleanPhoneForWa(phone) {
    let cleaned = String(phone).replace(/[^\d]/g, '');
    if (cleaned.startsWith('0')) cleaned = cleaned.substring(1);
    if (cleaned.startsWith('39')) cleaned = cleaned.substring(2);
    return cleaned;
}

function renderContacts(contacts, query) {
    contattiContainer.innerHTML = '';
    if (!contacts.length) {
        noResultsElement.classList.remove('hidden');
        return;
    }
    noResultsElement.classList.add('hidden');

    contacts.forEach(c => {
        const el = document.createElement('div');
        el.className = 'contatto';

        if (Number.isInteger(c.bday_mm)) el.dataset.mm = String(c.bday_mm).padStart(2,'0');
        if (Number.isInteger(c.bday_dd)) el.dataset.dd = String(c.bday_dd).padStart(2,'0');

        if (c.bday_mm === TODAY_MM && c.bday_dd === TODAY_DD) {
            el.classList.add('today-birthday');
        }

        let bdayHtml = '';
        const hasDM = Number.isInteger(c.bday_mm) && Number.isInteger(c.bday_dd);
        const hasY  = Number.isInteger(c.bday_yyyy);
        if (hasDM) {
            let label = '';
            if (hasY) {
                const eta = CURRENT_YEAR - c.bday_yyyy;
                label = String(eta);
            } else {
                const bdisp = c.bday_display || (String(c.bday_dd).padStart(2,'0') + '/' + String(c.bday_mm).padStart(2,'0'));
                label = bdisp;
            }
            const titleTxt = hasY ? `Età al 31/12/${CURRENT_YEAR}` : `Data`;
            bdayHtml = `<span class="bday-badge" title="${titleTxt}">🎂 ${label}</span>`;
        }

        let telefoniHtml = '';
        if (c.telefoni) {
            for (const [tipo, numero] of Object.entries(c.telefoni)) {
                const isCell = /cell|mob/i.test(tipo);
                const labelTipo = highlightText(tipo, query);
                const labelNum  = highlightText(numero, query);
                if (isCell) {
                    const wa = `https://wa.me/39${cleanPhoneForWa(numero)}`;
                    telefoniHtml += `<span class="telefono">${labelTipo}: <a target="_blank" href="${wa}">${labelNum}</a></span>`;
                } else {
                    telefoniHtml += `<span class="telefono">${labelTipo}: ${labelNum}</span>`;
                }
            }
        }

        let groupsHtml = '';
        if (Array.isArray(c.groups_names) && c.groups_names.length) {
            const star = c.groups_names.map(n => `*${n}`).join(', ');
            groupsHtml = `<span class="groups-line"><strong>Gruppi:</strong> ${highlightText(star, query)}</span>`;
        }

        const all = (c.note || '').split('\n').map(s => s.trim()).filter(Boolean).map(normalizeBracketPrefix);
        const plain = all.filter(l => !lineIsBracketed(l));
        const bracket = all.filter(l => lineIsBracketed(l) && !bracketLineShouldHide(l));
        
        const notePlainHtml = plain.map(l => `<span class="note-line">${highlightText(l, query)}</span>`).join('');
        const noteBracketHtml = bracket.map(l => `<span class="note-line">${highlightText(l, query)}</span>`).join('');

        el.innerHTML = `
            <div class="contatto-nome">
                <span class="nome">${highlightText(c.nome_completo, query)}</span>
                ${bdayHtml}
            </div>
            ${c.bday_display ? `<div class="contatto-bday"><b>${highlightText(c.bday_display, query)}</b></div>` : ''}
            <div class="contatto-details">
                ${telefoniHtml}
                ${groupsHtml}
                ${notePlainHtml}
                ${noteBracketHtml}
            </div>
        `;
        contattiContainer.appendChild(el);
    });

    if (CURRENT_MODE === 'chrono' && AUTO_SCROLL_PENDING && (searchInput.value.trim() === '')) {
        scrollToToday();
        AUTO_SCROLL_PENDING = false;
    }
}

function applySearch(q) {
    const base = getSourceForMode();
    const tokens = (q || '').toLowerCase().trim().split(/\s+/).filter(Boolean);

    let filtered = base;
    if (tokens.length) {
        filtered = base.filter(c => {
            const blob = visibleBlobForContact(c);
            const phones = (c.search_telefoni || '');
            return tokens.every(t => (/^\d+$/.test(t) ? phones.includes(t) : blob.includes(t)));
        });
    }

    renderContacts(filtered, q);
    updateStats(filtered.length);
}

function scrollToToday() {
    const items = Array.from(contattiContainer.querySelectorAll('.contatto'))
        .filter(el => el.dataset.mm && el.dataset.dd);
    if (!items.length) return;

    const targetKey = TODAY_MM * 100 + TODAY_DD;
    let best = null, bestKey = 9999;
    for (const el of items) {
        const k = parseInt(el.dataset.mm,10) * 100 + parseInt(el.dataset.dd,10);
        if (k >= targetKey && k < bestKey) { best = el; bestKey = k; }
    }
    if (!best) best = items[0];
    best.scrollIntoView({ block:'start', behavior:'smooth' });
}

function scrollToFirstMatch() {
    const firstMatch = document.querySelector('.contatto:not(.hidden)');
    if (firstMatch) {
        firstMatch.scrollIntoView({ block: 'start', behavior: 'smooth' });
    }
}
